import React from "react";
import {NavLink} from 'react-router-dom';

const Menu=()=>
{

    return(
<>
<div className="mainMenu">


<NavLink exact to='/' activeClassName="active_class">About Us</NavLink>
<NavLink exact to='/services' activeClassName="active_class">Services</NavLink>
<NavLink exact to='/search' activeClassName="active_class">Search</NavLink>
<NavLink exact to='/user/harshali/sharma' activeClassName="active_class">User</NavLink>

<NavLink  exact to='/contact' activeClassName="active_class">Contact</NavLink>


</div>

</>
    );
};


export default Menu;
